import UIKit

class CategoriesViewController: UIViewController, CategoriesViewProtocol {

	
    var presenter: CategoriesPresenterProtocol!
    var configurator: CategoriesConfiguratorProtocol = CategoriesConfigurator()
    let selfToCategory = "CategoriesToCategorySegue"
	override func viewDidLoad() {
        super.viewDidLoad()
        configurator.configure(with: self)
        presenter.configureView()
    }
    @IBAction func openCategory(_ sender: Any) {
        presenter.openCategory()
    }
    
}
